script: |
  super -f text -I q10311.spq | sort > q10311.out

inputs:
  - name: q10311.spq
    data: |
      SELECT + + col1 AS col0 FROM tab1 (FORMAT parquet) WHERE NOT 46 / col0 + - - 33 BETWEEN NULL AND - - col2 * col2 * + col2 + 92 / + 83 + + + CAST ( NULL AS INTEGER ) * + col0;
  - name: tab1

outputs:
  - name: q10311.out
    data: |
